import React, { Component } from "react";
import Navbar from "./commons/Components/Navbar";
import Footer from "./commons/Components/Footer";
import Homepage from "./all_components/Homepage";
import Login from "./homepage/Components/Login";
import Register from "./homepage/Components/Register";
import Category from "./homepage/Components/Category";
import Threads from "./homepage/Components/Threads";
import Posts from "./homepage/Components/Posts";
import { BrowserRouter as Router, Switch, Route, useHistory} from "react-router-dom";

const history = useHistory();
export default class App extends Component {
  render() {
    return (
      <Router>
        <div className="App">
          <Navbar />
          <Switch>
            <Route
              exact
              path="/"
              render={(props) => (
                <div>
                  <Homepage />
                </div>
              )}
            />
            <Route
              path="/register"
              render={(props) => (
                <div>
                  <Register />
                </div>
              )}
            />

            <Route
              exact
              path="/login"
              render={(props) => (
                <div>
                  {document.cookie.split("token=")[1] ? history.push("/login/categorys") : <Login/>}
                </div>
              )}
            /> 

            <Route
              path="/login/categorys"
              render={(props) => (
                <div>
                  {document.cookie.split("token=")[1] ? <Category/> : <Login/>}
                </div>
              )}
            /> 

            <Route
              path="/category/:id"
              render={(props) => (
                <div>
                  {document.cookie.split("token=")[1] ? <Threads/> : <Login/>}
                </div>
              )}
            /> 

            <Route
              path="/post/:id"
              render={(props) => (
                <div>
                  {document.cookie.split("token=")[1] ? <Posts/> : <Login/>}
                </div>
              )}
            /> 

          </Switch>
          <Footer />
        </div>
      </Router>
    );
  }
}
